import React from "react";
import Carousel from "react-material-ui-carousel";
import { Paper } from "@mui/material";
import { Carflex } from "./carouselcss";

export function Example(props) {
  const items = [
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
  ];

  return (
    <Carousel
      navButtonsProps={{
        style: {
          backgroundColor: "#000000",
          color: "white",
        },
      }}
      animation={"slide"}
    >
      {items.map((el, i) => {
        return (
          <Carflex>
            <Item key={i} src={el} />
            <Item key={i} src={items[(i + 1) % items.length]} />
            <Item key={i} src={items[(i + 2) % items.length]} />
          </Carflex>
        );
      })}
    </Carousel>
  );
}

export function Item(props) {
  return (
    <Paper className="items">
      <img src={props.src} alt="" width={"100%"} height="100%" />
    </Paper>
  );
}
